import React from "react";
import './Introduction.css';
import Typed from 'react-typed';

const Introduction = () =>{
    return(
    <div className="introduction">
    <Typed
     strings ={<h1 className='white f1 mt5'>Hi, my name is Regi Loshi <br/>I'm a  Software Engineering Student.</h1>}
     />
    </div>
    )
}
export default Introduction;
